import React from 'react';
import './loading.scss';

export class Loading extends React.Component {
    render() {
        return (
            <div className="loading">
                <svg className="spinner" viewBox="0 0 50 50">
                    <circle
                        className="path"
                        cx="25"
                        cy="25"
                        r="20"
                        fill="none"
                        strokeWidth="5"
                    ></circle>
                </svg>
            </div>
        );
    }
}
